import React, { Component } from "react";
import axios from "axios";
import '../../components/common/2columns_layout.css';
import '../../components/common/2columns_layout.css';
import '../../components/common/PlaceBox.css';
import '../../pages/TopProvince/TopProvince.css';
import Navbar from '../../components/common/navbarPage.js';
// import NextButton from '/Users/j.kanlaya/Downloads/Mike/website/geovisualization/src/components/common/NextButton.js';
import {Link} from 'react-router-dom';
import arrow from '../../images/TopProvince/12_arrow-right.png';
import styled from 'styled-components';

const StyledButton = styled(Link)`
    width: 60px;
    height: 100%;
    background-color: #5863F8;
    color: white;
    border: 0;
    display: flex;
    justify-content: center;
    align-items: center;
    background-image: url(${arrow});
    background-repeat: no-repeat;
    background-position: center;
    cursor: pointer;
`

export default class TopProvince extends Component {
  state = {
    provinceResponse: [],
    rank1:[],
    rank2:[],
    rank3:[],
    rank4:[],
    rank5:[],
    rank6:[],
    rank7:[],
    rank8:[],
    rank9:[],
    rank10:[],
  }

  componentDidMount() {
    axios.get(`http://localhost:30011/getRankProvince?provinceRank=1`)
      .then(res => {
        this.setState({ rank1 : res.data[0] });
      })
    axios.get(`http://localhost:30011/getRankProvince?provinceRank=2`)
    .then(res => {
      this.setState({ rank2 : res.data[0] });
    })
    axios.get(`http://localhost:30011/getRankProvince?provinceRank=3`)
      .then(res => {
        this.setState({ rank3 : res.data[0] });
      })
      axios.get(`http://localhost:30011/getRankProvince?provinceRank=4`)
      .then(res => {
        this.setState({ rank4 : res.data[0] });
      })
      axios.get(`http://localhost:30011/getRankProvince?provinceRank=5`)
      .then(res => {
        this.setState({ rank5 : res.data[0] });
      })
      axios.get(`http://localhost:30011/getRankProvince?provinceRank=6`)
      .then(res => {
        this.setState({ rank6 : res.data[0] });
      })
      axios.get(`http://localhost:30011/getRankProvince?provinceRank=7`)
      .then(res => {
        this.setState({ rank7 : res.data[0] });
      })
